import React from 'react';
import Lottie from 'lottie-react';
import animationData from '../test.json'; // Assurez-vous que le chemin vers le fichier Lottie est correct
import styled from 'styled-components';

const LottieWrapper = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  width: 100vw;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: transparent;
  z-index: 9999;
`;

const LottieAnimation = () => {
  return (
    <LottieWrapper>
      <Lottie animationData={animationData} loop={false} style={{ width: '100vh', height: '100vh' }} />
    </LottieWrapper>
  );
};

export default LottieAnimation;
